import React from "react";
import { createAppContainer } from "react-navigation";
import { createStackNavigator } from "react-navigation-stack";
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { MaterialCommunityIcons } from '@expo/vector-icons';
import Fruits from "./src/screens/Fruits";
import HomeN from "./src/screens/HomeNeeds";
import HomeScreen from "./src/screens/HomeScreen";
import Meat from "./src/screens/Meat";
import Vegetables from "./src/screens/Vegetables";


const Tab = createBottomTabNavigator();
const form = createStackNavigator();
const HomeStack = createStackNavigator();

function HomeStackScreen() {

  return (

    <HomeStack.Navigator
    screenOptions={{
      headerShown : false}}>
      <HomeStack.Screen name="Home" component={HomeScreen} />
      <HomeStack.Screen name="Vegetables" component={Vegetables} />
      <HomeStack.Screen name="Fruits" component={Fruits} />
      <HomeStack.Screen name="Neat" component={Meat} />

    </HomeStack.Navigator>
  );
}

function MyTabs() {
  return (

    <Tab.Navigator screenOptions={{
      headerShown : false,

      tabBarStyle: {

              backgroundColor: 'black',

      },
  }}>

      <Tab.Screen name="home" component={HomeStackScreen}  
      options={{
          tabBarLabel: 'Home',
          tabBarIcon: ({ color, size }) => (
            <MaterialCommunityIcons name="home" color={"white"} size={30} />
          ),
        }}/>
        <Tab.Screen name="Contact" component={ContactInfo} 
      options={{
        tabBarLabel: 'Contact',
        tabBarIcon: ({ color, size }) => (
          <MaterialCommunityIcons name= "phone" color={"white"} size={30} />
        ),
      }}/>
    </Tab.Navigator>

  );
}



export default function App() {

  return (

      <NavigationContainer  >
      <MyTabs />
    </NavigationContainer>
  );
}



